$(function(){$("#txtPlaceholderSearch").autocomplete({source:function(n,t){$.ajax({url:"/Home/AutoCompleteArticles",type:"POST",dataType:"json",data:{term:n.term},success:function(n){t($.map(n,function(n){return{label:n.ArticleName,value:n.ArticleURL}}))}})},messages:{noResults:"",results:""},select:function(n,t){return $("#txtPlaceholderSearch").val(t.item.label),window.location.href=t.item.value,!1},focus:function(n,t){n.preventDefault();$("#txtPlaceholderSearch").val(t.item.label)}})});